load("@rules_cc_autoconf//autoconf:package_info.bzl", "package_info") package_info(name, module_bazel, package_bugreport, package_name, package_url, package_version) A rule for parsing module info from MODULE.bazel files. This rule is most useful when paired with the autoconf rule. Example: load("@rules_cc_autoconf//autoconf:autoconf.bzl", "autoconf")
