) autoconf( name = "config_h", out = "config.h", checks = [ # ... ], deps = [ ":package_info", ],
) ATTRIBUTES Name Description Type Mandatory Default name A unique name for this target. Name required module_bazel A MODULE.bazel file to parse module information from. Mutually exclusive with package_name and package_version. Label optional None package_bugreport The package bug report email/URL. Used to populate PACKAGE_BUGREPORT define. String optional "" package_name The package name. Must be provided together with package_version if module_bazel is not provided. String optional "" package_url The package home page URL. Used to populate PACKAGE_URL define. String optional "" package_version The package version. Must be provided together with package_name if module_bazel is not provided. String optional ""

