load("@rules_cc_autoconf//autoconf:autoconf_hdr.bzl", "autoconf_hdr") autoconf_hdr(name, deps, out, inlines, template) Generate configuration headers from results provided by autoconf targets. This rule takes check results from autoconf targets (via deps) and generates a header file. The template file (if provided) is used to format the output header. Example: load("@rules_cc_autoconf//autoconf:autoconf.bzl", "autoconf")
load("@rules_cc_autoconf//autoconf:autoconf_hdr.bzl", "autoconf_hdr")
load("@rules_cc_autoconf//autoconf:macros.bzl", "macros") autoconf( name = "config_checks", checks = [ macros.AC_CHECK_HEADER("stdio.h"), macros.AC_CHECK_HEADER("stdlib.h"), macros.AC_CHECK_FUNC("printf"), ],
) autoconf_hdr( name = "config", out = "config.h", deps = [":config_checks"], template = "config.h.in",
) This allows you to run checks once and generate multiple header files from the same results. ATTRIBUTES Name Description Type Mandatory Default name A unique name for this target. Name required deps List of autoconf targets which provide check results. Results from all deps will be merged together, and duplicate define names will produce an error. If not provided, an empty results file will be created. List of labels optional [] out The output config file (typically config.h). Label; nonconfigurable required inlines A mapping of strings to files for replace within the content of the given template attribute.The exact string in the template is replaced with the content of the associated file. Any @VAR@ style placeholders in the inline file content will be replaced with their corresponding define values (package info, check results, etc.) after insertion. Dictionary: String -> Label optional {} template Template file (config.h.in) to use as base for generating the header file. The template is used to format the output header, but does not generate any checks. Label required
